import React from "react";
import { BrowserRouter, Router, Route, Switchs } from "react-router-dom";
import Navbar from "./components/layout/Navbar";
import "./App.css";

const App = props => {
  return (
    <Router>
      <div className="App">
        <Navbar />
        <h1>My App</h1>
      </div>
    </Router>
  );
};

export default App;
